import * as React from 'react';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';

function App() {
  return (
    <center id="App">
      <div className="poster" style={{ 
        backgroundImage: `url("wanted.png")` 
      }} >
      <center id="content">
        <div className='inputStuff'>
          <img src="https://static.remove.bg/remove-bg-web/3a4699427405e2861e1fd6aabd6280baee37b558/assets/start_remove-c851bdf8d3127a24e2d137a55b1b427378cd17385b01aec6e59d5d4b5f39d2ec.png" alt="randomPerson" width="200" height="200"/>
          <p>
            they aren't actually a real person. You can make up their info...
          </p>
          <form>
            <div className="input"><TextField label="First Name" /></div>
            <div className="input"><TextField label="Last Name" /></div>
            <div className="input"><TextField  label="Occupation" /></div>
          </form>
        </div>
        <br/>
        <div className="submit">
          <span className="butt">
            <Button variant="contained" color="success">Submit</Button>
          </span>
          <span className='butt'>
            <Button variant="outlined" color="error">Delete</Button>
          </span>
        </div>
      </center>
      </div>
    </center>
  );
}

export default App;
